import { useEffect, useState } from "react";
import ms from "ms";
import moment from "moment";
function App() {

  const [birthday, setBirthday] = useState(null);
  const [minDate, setMinDate] = useState(null);
  const [maxDate, setMaxDate] = useState(null);
  useEffect(() => {
    const minsec = ms("14d");
    console.log("minsec", minsec);
    const min_date = new Date(+new Date(birthday) - minsec);
    const max_date = new Date(+new Date(birthday) + minsec);
    setMinDate(moment(min_date).format("YYYY-MM-DD"));
    setMaxDate(moment(max_date).format("YYYY-MM-DD"));
  }, [birthday]);
  return (
    <div className="App">
      <center>
        <label htmlFor="">birthday {birthday}</label>
        <br />
        <input type="date" onChange={(e) => setBirthday(e.target.value)} />
        <br />
        <br />
        <label htmlFor="">
          annual leave from {minDate} to {maxDate}
        </label>
        <br />
        <input type="date" min={minDate} max={maxDate} />
        <br />
        <input type="number" min={1} max={10} />
        <input
          type="number"
          id="tentacles"
          name="tentacles"
          min={10}
          max={100}
        />
      </center>
    </div>
  );
}
export default App;
